import React, {useState, useContext} from 'react';
import { styled } from '@mui/material/styles';
import Container from '@mui/material/Container';
import Button from '../components/small-components/Button';
import TextBox from '../components/small-components/TextBox';
import * as Constantans from '../Constants';
// import { U } from './ChooseRolePage';
import { UserRole } from '../context/UserRole';
import FormPage from './FormPage';

function questionType(role){
  if(role === 'mentor'){
    return(
      Constantans.MENTOR_QUESTIONS
    )
  }
  else if (role === 'mentee'){
    return(
      Constantans.MENTEE_QUESTIONS
    )
  }
  else {
    return(
      []
    )
  }
}

const RegFormPage = () => {
  const {role, setRole} = useContext(UserRole);
  return (
    <>
    <h1>{role}</h1>
    <FormPage filedsArray = {questionType(role)} />
    </>
  ) 
  };

export default RegFormPage;
